		// function that updates outputSum value
		function updaterSum(){
			let x = outputSum + bulbSum;
			return outputSum = x;
		}
		//add and subtraction buttons function
		this.add_btn.addEventListener("click", addFunc);
		function addFunc() {
			let add = bulbSum + 0.01;
			let rndAdd = Math.round(add * 100) / 100;
			root.bulb_watt.text = rndAdd;
			
			if (add > 0.09){
				bulbSum = 0.09;
				return bulbSum = 0.09;
			}
			else {
				bulbSum = rndAdd - bulbSum;
				updaterSum();
				console.log("add "+outputSum);
				return bulbSum = rndAdd;
			}
		}
		this.sub_btn.addEventListener("click", subFunc);
		function subFunc() {
			let sub = bulbSum - 0.01;
			let rndSub = Math.round(sub * 100) / 100;
			root.bulb_watt.text = rndSub;
		
			if (sub <= 0.00){
				bulbSum = 0.01;
				return bulbSum = 0.01;
			}
			else {
				bulbSum = rndSub - bulbSum;
				updaterSum();
				console.log("sub "+outputSum);
				return bulbSum = rndSub;
			}
		}
